import React from "react";

export const Footer = () => {
  return (
    <footer>
      <div>
        <link
          href="https://fonts.googleapis.com/css?family=Expletus Sans"
          rel="stylesheet"
        ></link>
      </div>
      <div></div>
    </footer>
  );
};
